INSERT INTO `t_huati` VALUES (1, '去上海迪士尼有什么攻略？', 'https://www.zhihu.com/question/42804614', '订好了门票，想知道怎么去迪士尼、附近有什么酒店推荐（住不起迪斯尼酒店 ）以及其他的注意事项。', 1322, '2019-07-22 13:22:53', 'https://www.zhihu.com/api/v4/questions/42804614/answers?include=comment_count,voteup_count&limit=20&offset=0&platform=desktop&sort_by=default', '');
INSERT INTO `t_huati` VALUES (100, '在《英雄联盟》中你明白了哪些知识后，段位开始直线上升？', 'https://www.zhihu.com/question/331936013', '玩lol很多年，大部分是打打匹配，排位几乎都停留在白银阶段，很想上分，却又无从下手，想知道这个游戏要必须了解，或者必须做到哪些方面，就可以甩掉低端局的打法和意识，请各位大神不吝赐教。\r\n\r\n本人主要玩的是中路，单排自己优势，却又带不动队友，自己略势也不知道逆风怎么打。可以说说对线技巧，GANK技巧等等', 1595, '2019-07-22 17:40:43', 'https://www.zhihu.com/api/v4/questions/331936013/answers?include=comment_count,voteup_count&limit=20&offset=0&platform=desktop&sort_by=default', NULL);
